import Link from 'next/link';

const Index = () => (
    <div className='outerdiv'>
        <div className='titlelogo'>
            <Link href='/'>
                <a>slern.io</a>
            </Link>
        </div>
        <div className='signin'>
            <button>
                <Link href='/login'>
                    <a>Sign In</a>
                </Link>
            </button>

        </div>

        <style jsx>{`
        .outerdiv {
            background-color: linear-gradient(red, yellow, blue);
            width: 100%;
            height: 80px;
            display: grid;
            font-family: Arial; 
            grid-template-columns: 95% 5%;
            font-size: 20px;

        }
        .titlelogo {
            color: #2181D5;
            font-weight: bold;
            text-decoration: none;
            font-family: 'Arial';
            margin-left: 5px;
            margin-top: 5px;
        }
        .signin {
            color: #2181D5;
            font-weight: bold;
            text-decoration: none;
            font-family: 'Arial';
            margin-top: 5px;
            font-size: 20px;
        }
        a {
            text-decoration: none;
            font-family: 'Arial';
          }

          a:hover {
            opacity: 0.6;
          }
          body {
            margin:0;
            padding:0;
          }

        `}</style>
    </div>
);

export default Index;
